import React from 'react';
import Button from 'react-bootstrap/Button';
import Form from 'react-bootstrap/Form';

const DeleteWorkout = () => {
    
    return(
        <>
        <h6>Valitse muokattava treeni alasvetovalikosta</h6>
              <Form.Group>
                <Form.Control size="sm" as="select">
                    <option>treeni1</option>
                    <option>treeni2</option>
                    <option>treeni3</option>
                </Form.Control>
             </Form.Group>
          </>
    )
}
export default DeleteWorkout;
